<script>
function haversine(lat1, lon1, lat2, lon2) {
    const R = 6371000;
    const toRad = x => x * Math.PI / 180;
    const dLat = toRad(lat2 - lat1);
    const dLon = toRad(lon2 - lon1);
    const a = Math.sin(dLat/2)**2 + Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) * Math.sin(dLon/2)**2;
    return 2 * R * Math.asin(Math.sqrt(a));
}

function closestHydrant(lat, lon) {
    let minDist = Infinity;
    let nearest = null;
    for (const [hLat, hLon] of hydrants) {
        const dist = haversine(lat, lon, hLat, hLon);
        if (dist < minDist) {
            minDist = dist;
            nearest = [hLat, hLon, dist];
        }
    }
    return nearest;
}

window.addEventListener("load", function () {
    let map;
    for (let key in window) {
        if (window[key] && window[key]._leaflet_id !== undefined) {
            map = window[key];
            break;
        }
    }
    if (!map) {
        console.error("Map not found");
        return;
    }

    map.on('click', function(e) {
        const lat = e.latlng.lat;
        const lon = e.latlng.lng;
        const nearest = closestHydrant(lat, lon);
        if (!nearest) return;

        const popupContent = 'üî• Fire reported here.<br>Closest hydrant: ' + nearest[2].toFixed(1) + ' meters away.';
        const marker = L.marker([lat, lon]).addTo(map);
        marker.bindPopup(popupContent).openPopup();
        const line = L.polyline([[lat, lon], [nearest[0], nearest[1]]], {color: 'orange'}).addTo(map);
    });
